--
-- Table structure for table `acl_rules`
--

CREATE TABLE `acl_rules`
(
    `rule_id`          int(11)        NOT NULL,
    `rule_parent_id`   int(11)                 DEFAULT NULL,
    `module_id`        varchar(50)    NOT NULL,
    `rule_description` varchar(100)   NOT NULL,
    `rule_check_id`    varchar(100)   NOT NULL,
    `superadmin_only`  tinyint(1)     NOT NULL DEFAULT '0',
    `crm_only`         enum ('Y','N') NOT NULL DEFAULT 'N',
    `rule_visible`     tinyint(1)     NOT NULL DEFAULT '0',
    `rule_order`       int(11)        NOT NULL DEFAULT '0'
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='Access rights to all parts of the web site are described here. Each access right can be dynamic, so real access will be checked by rule_check_id option (if enabled for specific role).';

