CREATE TABLE `applicant_form_fields`
(
    `applicant_field_id`        int(11) UNSIGNED                                                                                                                                                                                                                                                                                                                                                       NOT NULL,
    `member_type_id`            int(2) UNSIGNED                                                                                                                                                                                                                                                                                                                                                        NOT NULL,
    `company_id`                bigint(20)                                                                                                                                                                                                                                                                                                                                                             NOT NULL,
    `applicant_field_unique_id` varchar(100)                                                                                                                                                                                                                                                                                                                                                                    DEFAULT NULL,
    `type`                      enum ('text','password','number','email','phone','memo','combo','country','agents','office','office_multi','assigned_to','radio','checkbox','date','date_repeatable','photo','file','office_change_date_time','multiple_text_fields','html_editor','kskeydid','case_internal_id','applicant_internal_id','multiple_combo','reference','authorized_agents','hyperlink') NOT NULL DEFAULT 'text',
    `label`                     char(255)                                                                                                                                                                                                                                                                                                                                                                       DEFAULT NULL,
    `maxlength`                 int(6) UNSIGNED                                                                                                                                                                                                                                                                                                                                                                 DEFAULT NULL,
    `encrypted`                 enum ('Y','N')                                                                                                                                                                                                                                                                                                                                                         NOT NULL DEFAULT 'N',
    `required`                  enum ('Y','N')                                                                                                                                                                                                                                                                                                                                                         NOT NULL DEFAULT 'N',
    `required_for_submission`   enum ('Y','N')                                                                                                                                                                                                                                                                                                                                                         NOT NULL DEFAULT 'N',
    `disabled`                  enum ('Y','N')                                                                                                                                                                                                                                                                                                                                                         NOT NULL DEFAULT 'N',
    `blocked`                   enum ('Y','N')                                                                                                                                                                                                                                                                                                                                                         NOT NULL DEFAULT 'N',
    `multiple_values`           enum ('Y','N')                                                                                                                                                                                                                                                                                                                                                         NOT NULL DEFAULT 'N',
    `skip_access_requirements`  enum ('Y','N')                                                                                                                                                                                                                                                                                                                                                         NOT NULL DEFAULT 'N',
    `custom_height`             int(11) UNSIGNED                                                                                                                                                                                                                                                                                                                                                       NOT NULL DEFAULT '0'
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='Contains fields that are used/showed in the client''s profile. Each field''s unique id (saved in applicant_field_unique_id) must be unique for specific client type (described in applicant_form_order table).';

