--
-- Table structure for table `client_form_field_access`
--

CREATE TABLE `client_form_field_access`
(
    `access_id`      int(11) UNSIGNED NOT NULL,
    `role_id`        int(11)                   DEFAULT NULL,
    `field_id`       int(11) UNSIGNED          DEFAULT NULL,
    `client_type_id` int(11) UNSIGNED          DEFAULT NULL,
    `status`         enum ('R','F')   NOT NULL DEFAULT 'R' COMMENT 'R=read only, F=full access'
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='Identifies if specific role has access to specific case''s field. If there is no record here - role has not access to the field. Because the same field can be used in different case types - case type id is used here too.';

