--
-- Table structure for table `company_prospects_notes`
--

CREATE TABLE `company_prospects_notes`
(
    `note_id`     bigint(20) UNSIGNED NOT NULL,
    `prospect_id` bigint(20)       DEFAULT NULL,
    `company_id`  bigint(20)       DEFAULT NULL,
    `author_id`   int(11) UNSIGNED DEFAULT NULL,
    `note`        text,
    `create_date` datetime         DEFAULT NULL
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='Company prospect''s notes are saved here (showed in the Notes tab).';

-- --------------------------------------------------------

--
-- Table structure for table `company_prospects_selected_categories`
--

CREATE TABLE `company_prospects_selected_categories`
(
    `company_id`           bigint(20)       NOT NULL,
    `prospect_category_id` int(11) UNSIGNED NOT NULL,
    `order`                tinyint(3) UNSIGNED DEFAULT '0'
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='Each company can have own list of prospect categories that can be used to assign prospects during their creation.';

-- --------------------------------------------------------

--
-- Table structure for table `company_prospects_settings`
--

CREATE TABLE `company_prospects_settings`
(
    `company_id`  bigint(20) NOT NULL,
    `prospect_id` bigint(20) NOT NULL,
    `viewed`      enum ('Y','N') DEFAULT 'N',
    `email_sent`  enum ('Y','N') DEFAULT 'N'
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='Contains info about company prospects settings.';

-- --------------------------------------------------------

--
-- Table structure for table `company_prospects_templates`
--

CREATE TABLE `company_prospects_templates`
(
    `prospect_template_id` int(11) UNSIGNED NOT NULL,
    `company_id`           bigint(20)       NOT NULL,
    `author_id`            bigint(20)                DEFAULT NULL,
    `name`                 char(255)                 DEFAULT NULL,
    `subject`              char(255)                 DEFAULT NULL,
    `from`                 char(255)                 DEFAULT NULL,
    `to`                   char(255)                 DEFAULT NULL,
    `cc`                   char(255)                 DEFAULT NULL,
    `bcc`                  char(255)                 DEFAULT NULL,
    `message`              longtext,
    `template_default`     enum ('Y','N')   NOT NULL DEFAULT 'N',
    `create_date`          date                      DEFAULT NULL
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='List of templates that can be used during new prospects creation/assigning.';

