idth=\"85%\">GST ()</td>\n<td align=\"right\" width=\"15%\">${invoice: gst/hst fee}</td></tr>\n<tr>\n<td colspan=\"4\" width=\"100%\"><br></td></tr>\n<tr>\n<td colspan=\"3\" align=\"right\" width=\"85%\"><b>TOTAL</b></td>\n<td align=\"right\" width=\"15%\"><strong>${special cc charge: amount}</strong></td></tr></tbody></table><br>\n<div>\n<center><b>Thank you for using our services. Please do not hesitate to contact us, if we can be of further assistance in the future.</b></center></div>\n<p></p>',
