VALUES (24, 'system', 'Certificate of Naturalisation (for PDF generation)',
        'Certificate of Naturalisation (for PDF generation)', '', '', '', '',
        '<table border=\"0\" cellpadding=\"3\" align=\"left\" width=\"100%\">\n                 <tr>\n                  <td width=\"75%\" style=\"font-weight: bold;\">COMMONWEALTH OF DOMINICA CITIZENSHIP ACT (Ch.1:10)</td>\n                  <td width=\"25%\" align=\"right\" style=\"font-weight: bold;\">SECTION 8</td>\n                 </tr>\n                </table>\n                <h1 align=\"center\">CERTIFICATE OF NATURALISATION</h1>\n                <p style=\"text-indent: 30px;\">WHEREAS <i><b>{main_applicant_name}</b></i> has applied to the Minister responsible for citizenship in the Government of Dominica for a certificate of naturalisation, alleging with respect to {self_name} the particulars set out below, and has satisfied the Minister that the conditions laid down in the Constitution and in the Citizenship Act Chapter 1:10 for the grant of a certificate of naturalisation are fulfilled:</p>\n                <p style=\"text-indent: 30px;\">Now, THEREFORE, the Minister, in exercise of the powers conferred upon him by the said Constitution and Act, grants to the said <i><b>{main_applicant_name_2}</b></i> this Certificate of Naturalisation, and declares that upon taking the oath or affirmation of allegiance in the manner required by the Act shall be a citizen of Dominica as from the date of this certificate.</p>\n                <p style=\"text-indent: 30px;\">In witness whereof I have hereto subscribed my name this ____ day of _________, ______.</p>\n                <p></p>\n                <p></p>\n                <p></p>\n                <table border=\"0\" cellpadding=\"3\" align=\"left\" width=\"100%\">\n                 <tr>\n                  <td width=\"65%\"></td>\n                  <td width=\"35%\" style=\"font-size: 8px; font-style: italic;\"><br />MINISTER FOR JUSTICE, IMMIGRATION <br />AND NATIONAL SECURITY</td>\n                 </tr>\n                </table>\n                <p></p>\n                <p align=\"center\" style=\"font-weight: bold; font-size: 10px;\">Particulars relating to applicant</p>\n                <table border=\"0\" cellpadding=\"0\" align=\"left\" width=\"100%\" style=\"font-size: 10px;\">\n                 <tr>\n                  <td width=\"32%\"></td>\n                  <td width=\"25%\">FULL NAME:</td>\n                  <td width=\"43%\">{main_applicant_name_3}</td>\n                 </tr>\n                 <tr><td colspan=\"3\"></td></tr>\n                 <tr>\n                  <td width=\"32%\"></td>\n                  <td width=\"25%\">ADDRESS:</td>\n                  <td width=\"43%\">{address}</td>\n                 </tr>\n                 <tr><td colspan=\"3\"></td></tr>\n                 <tr>\n                  <td width=\"32%\"></td>\n                  <td width=\"25%\">PROFESSION/<br />OCCUPATION:</td>\n                  <td width=\"43%\">{occupation}</td>\n                 </tr>\n                 <tr><td colspan=\"3\"></td></tr>\n                 <tr>\n                  <td width=\"32%\"></td>\n                  <td width=\"25%\">PLACE OF BIRTH:</td>\n                  <td width=\"43%\">{place_of_birth}</td>\n                 </tr>\n                 <tr><td colspan=\"3\"></td></tr>\n                 <tr>\n                  <td width=\"32%\"></td>\n                  <td width=\"25%\">DATE OF BIRTH:</td>\n                  <td width=\"43%\">{date_of_birth}</td>\n                 </tr>\n                 <tr><td colspan=\"3\"></td></tr>\n                 <tr>\n                  <td width=\"32%\"></td>\n                  <td width=\"25%\">SINGLE/MARRIED, etc.:</td>\n                  <td width=\"43%\">{marital_status}</td>\n                 </tr>\n                 <tr><td colspan=\"3\"></td></tr>\n                 <tr>\n                  <td width=\"32%\"></td>\n                  <td width=\"25%\">NAME OF SPOUSE:</td>\n                  <td width=\"43%\">{name_of_spouse}</td>\n                 </tr>\n                </table>',
        '2018-02-16'),
       (25, 'system', 'Upgrade to OfficioSolo', 'Upgrade to Solo', 'support@officio.com.au', '{company email}', '',
        'support@officio.com.au',
        '<table>     <tr>         <td>             <img src=\"{settings: images path}/default/officio_logo_with_bg.png\" alt=\"logo\" width=\"600\" height=\"94\" />         </td>     </tr>      <tr>      <td>       <table width=\"600\" align=\"center\" bgcolor=\"#b3bcbf\" border=\"0\" cellpadding=\"6\" cellspacing=\"1\">         <tbody>           <tr>             <td bgcolor=\"#ffffff\">               <table width=\"100%\" border=\"0\" cellpadding=\"5\" cellspacing=\"0\">                 <tbody>                   <tr>                     <td style=\"font: 11px Arial,Helvetica,sans-serif; text-align: left;\" bgcolor=\"#f0f0f0\">                          <table width=\"100%\" border=\"0\" cellpadding=\"5\">                           <tbody>                             <tr>                               <td>                                   <div style=\"font: 11px Arial,Helvetica,sans-serif;\">Dear {admin first name} {admin last name},<br><br>Thank you for your order. Here are your order details:</div>                               </td>                             </tr>                           </tbody>                         </table>                        <table width=\"100%\" border=\"1\" cellpadding=\"6\">                         <tbody>                           <tr>                             <td bgcolor=\"#ffffff\">                               <table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">                                 <tbody>                                   <tr>                                     <td style=\"font: 11px Arial,Helvetica,sans-serif;\" nowrap=\"nowrap\"><span style=\"color: #4F8CBC; font-weight: bold;\">Upgrade to Solo - Prorated</span><br>                                         <strong>Licensee Name:</strong>&nbsp;&nbsp;{company name}                                     </td>                                   </tr>                                 </tbody>                               </table>                 