                                 <td style=\"font: 11px Arial,Helvetica,sans-serif;\">&nbsp;</td>                                   <td style=\"font: 11px Arial,Helvetica,sans-serif;\" align=\"center\">&nbsp;</td>                                   <td style=\"font: 11px Arial,Helvetica,sans-serif; font-weight: bold;\" align=\"right\">Total</td>                                   <td style=\"font: 11px Arial,Helvetica,sans-serif;\" align=\"right\">{invoice: currency} {invoice: total}</td>                             </tr>                             <tr>                                   <td style=\"font: 11px Arial,Helvetica,sans-serif;\">&nbsp;</td>                                   <td style=\"font: 11px Arial,Helvetica,sans-serif;\" align=\"center\">&nbsp;</td>                                   <td style=\"font: 11px Arial,Helvetica,sans-serif; font-weight: bold;\" align=\"right\">Paid</td>                                   <td style=\"font: 11px Arial,Helvetica,sans-serif;\" align=\"right\">{invoice: currency} -{invoice: amount paid}</td>                             </tr>                             <tr>                               <td colspan=\"4\" nowrap=\"nowrap\" height=\"38\">                                 <table width=\"100%\" border=\"0\">                                     <tr>                                       <td style=\"font: 11px Arial,Helvetica,sans-serif;\" width=\"18%\" nowrap=\"nowrap\"><strong>Payment method:</strong></td>                                       <td style=\"font: 11px Arial,Helvetica,sans-serif;\" width=\"82%\">{invoice: payment method}</td>                                     </tr>                                 </table>                               </td>                             </tr>                         </table>                          <table width=\"100%\" border=\"0\" cellpadding=\"5\">                           <tbody>                             <tr>                               <td style=\"font: 11px Arial,Helvetica,sans-serif;\">                                   <p><strong>A couple of quick notes and reminders:</strong></p>                                   <ul>                                     <li><strong>Payment:</strong> Your credit card&nbsp; has been debited with {invoice: currency} {invoice: amount paid}, your card statement will list &quot;UNIQUES SOFTWARE&quot;.</li>                                     <li><strong>My account:</strong> You can always access your invoices by logging into Officio, and going to Admin | Company Details | Company Invoices. </li>                                   </ul>                                   <p>Thank you for your order. If we can do anything to enhance your experience with Officio, please do not hesitate to let us know.</p></td>                             </tr>                           </tbody>                         </table>                          <p>                     </td>                   </tr>                 </tbody>               </table>             </td>           </tr>         </tbody>       </table>     </td>   </tr> </table>',
