       (9290, 1, 7174, 74, 'Welcome', 'Email', 'Welcome', 'Re: Welcome', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<div><br><p>I would like to welcome you to &lt;%company_name%&gt;.</p><p>Please note that your client ID is: &lt;%file_number%&gt;. Please use this reference number in all communications with us.</p><p>We are thrilled to have you as our client and are looking forwards to working with you. Your &lt;%visa_subclass%&gt; matter will be handled by &lt;%registered_migrant_agent%&gt; and &lt;%processing%&gt;.</p><p>You will receive further communications from us very soon. Meanwhile, please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt; if you have any questions.</p><p>Once again, thank you for choosing our services.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p></p></div>',
        '2014-06-05', 'N', 0),
       (9291, 1, 7174, 74, 'General', 'Email', 'User ID and Password Notification',
        'RE: Your Client Portal Information', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p></p><p>Welcome to &lt;%company_name%&gt;\'s Client Portal.</p><p><br>We have created an account on our Client Portal for you. This portal allows you to view your profile, upload your documents, fill out your forms and get the latest updates on your file.</p><p></p><p>You can access this portal by clicking on the following link:</p><p></p><p><a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a><br><br>Your log in details are as follows:<br><br>User name:- <b>&lt;%username%&gt;</b><br>Password:- <b>&lt;%password%&gt;</b></p><p>Please keep this information secured, and ensure that you log out from this portal after each visit.</p><p></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9292, 1, 7174, 74, 'General', 'Email', 'Document Checklist', 'RE: Documents Request', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;<p>Please find attached Documents Checklist for your &lt;%visa_subclass%&gt; matter.</p><p>You may upload your documents using your Client Portal User ID and Password. You can access client portal through this link: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a>&nbsp;</p><p>Alternatively, you may email your documents to &lt;%company_email%&gt; or post them to &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_zip%&gt; &lt;%company_state%&gt; &lt;%company_country%&gt;</p><p>If you choose to upload or email your documents, please ensure they are fill colour scans, or certified copies of your originals. If you post your documents, please ensure that these are certified copies of your originals. Please do not send any original documents by post unless you have been specifically asked to do so. Please quote your Case Reference Number &lt;%file_number%&gt; if you email or post your documents.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or Email us on &lt;%company_email%&gt; if you have any questions.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9293, 1, 7174, 74, 'Payment', 'Email', 'Receipt of Payment AUD', 'RE: Receipt of Payment', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We acknowledge receipt of $&lt;%assign_deposit_amount%&gt;.</p><p>This amount will be kept in our Client Account and towards services completed. The following is a summary of your Client Account.</p><p>&lt;%aud_curr_trustac_summary_table%&gt;</p><p>Balance in Client Account: &lt;%trust_ac_balance_aud%&gt;</p><p>Thank you for your payment.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9294, 1, 7174, 74, 'General', 'Email', 'Form 929 Change of Address', 'RE: Change of Address Form 929', '', '',
        '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your new address. Please find attached Form 929 to be signed by you.</p><p>Please upload your signed form on your Client Portal. To access client portal, click: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>Alternatively, you may return the signed form by &lt;%company_email%&gt; or by post on &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9295, 1, 7174, 74, 'General', 'Email', 'Form 929 Change of Passport', 'RE: Form 929 Change of Passport', '', '',
        '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your new Passport Details. Please find attached Form 929 to be signed by you.</p><p>Please upload a colour scan of your new passport biopage (picture page) to your client portal along with the signed form 929. To access your client portal, click: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>You can also email us a colour scan of your passport and the form on &lt;%current_user_email%&gt;. Alternatively, you can post a certified copy of your new passport and signed form to your office address mentioned below.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9296, 1, 7174, 74, 'General', 'Email', 'Form 956 Agent Appointment', 'RE: Form 956', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;<p>Your appointed Registered Migration Agent for your &lt;%visa_subclass%&gt;&gt; matter is &lt;%registered_migrant_agent%&gt;.</p><p>Please find attached Form 956 to be signed by you. Please check the contents to ensure they are correct, and sign the form.</p><p>Please upload the signed form on your client portal. You can access the client portal by clicking on: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by email it to &lt;%company_email%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9297, 1, 7174, 74, 'General', 'Email', 'Form 1022', 'RE: Form 1022', 'support@officio.com.au', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying changes in your circumstances.Please find attached Form 1022 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access your client portal click:&nbsp;<a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>Alternatively, you may return the signed form by emailing it to &lt;%registered_migrant_agent%&gt; or by post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9298, 1, 7174, 74, 'General', 'Email', 'Form 1005', 'RE: Bridging Visa A - Form 1005', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your intentions to reinstate your Bridging Visa A. Please find attached Form 1005 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access the client portal, click:&nbsp;<a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by emailing it to &lt;%registered_migrant_agent%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>You may also choose to take completed and signed form to your nearest Department of Immigration office.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9299, 1, 7174, 74, 'General', 'Email', 'Form 1006', 'RE: Bridging Visa B - Form 1006', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for notifying us of your intention to obtain a Bridging Visa B. Please find attached Form 1006 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access client portal, click:&nbsp;<a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>Alternatively, you may return the signed form either by emailing it to &lt;%registered_migrant_agent%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>You may also choose to take completed and signed form to your nearest Department of Immigration office along with visa application fee.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
