        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We have booked your Medicals. Following are the details:</p><p>Medical Date: &lt;%medical_date%&gt;</p><p>X-Ray Date: &lt;%medical_xray_date%&gt;</p><p>Medical Reference Number: &lt;%medical_reference_number%&gt;</p><p>TRN: &lt;%medical_TRN%&gt;</p><p>HAP ID: &lt;%HAP_ID%&gt;</p><p>Location: &lt;%medical_exam_location%&gt;</p><p>Please contact us on &lt;%company_phone_1%&gt; or &lt;%company_email%&gt; if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
