        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;,<p>We have applied for your police clearance for &lt;%1_country_of_PCC%&gt; on &lt;%1_PCC_application_date%&gt;.</p><p>Your Reference Number for this application is &lt;%1_PCC_reference_number%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
