       (9302, 1, 7174, 74, 'General', 'Email', 'General Follow Up', 'RE: Follow Up', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<div><br><p>This email is to follow up from our recent conversation.</p><p>Please respond to us as soon as possible either by calling on &lt;%company_phone_1%&gt; or by emailing us on &lt;%company_email%&gt;.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p></div>',
