       (9303, 1, 7174, 74, 'General', 'Email', 'Draft Application', 'RE: Your Draft Application', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p><br></p><p>We have completed drafting the application for your &lt;%visa_subclass%&gt; matter.</p><p>Please log in to your client portal Click:&nbsp;<a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a>&nbsp;to access the draft of your application.</p><p>It is important that you review the information on your application. Please correct any information on this form if you believe it is not correct or complete, and inform us of any changes. Please confirm by email if the draft of application is correct.</p><p>Remember to save the form after you have updated any fields. If you are not able to make changes to the form online, you can also print and hand-write your changes on the form. Once completed, you may upload the scanned copy of your draft application to your client portal.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by email on &lt;%company_email%&gt; if you have any difficulties.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9304, 1, 7174, 74, 'General', 'Email', 'Letter to Department of Immigration - Application Letter',
        'RE: Applicaction', '', '', '',
        'To,<p>&lt;%immigration_office%&gt;</p><p>Date: &lt;%today_date%&gt;</p><p>Subject: &lt;%visa_subclass%&gt; Application for Client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;.</p><p><br></p><p>Dear Sir/Madam,</p><p><br></p><p>Please find herewith &lt;%visa_subclass%&gt; application of our client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;.</p><p>Following documents are attached:</p><p><font color=\"#ff0000\"><b>&lt;&lt;Insert list of Documents Here&gt;&gt;</b></font></p><p>Please feel free to contact us if you require any further information for this application.</p><p>our contact details:</p><p>&lt;%company_name%&gt;</p><p>&lt;%company_address%&gt; &lt;%company_city%&gt;</p><p>&lt;%company_state%&gt; - &lt;%company_zip%&gt;, &lt;%company_country%&gt;</p><p>Telephone: &lt;%company_phone_1%&gt;</p><p>Fax: &lt;%company_fax%&gt;</p><p>Email: &lt;%company_email%&gt;</p><p><br></p><p>Thanks and Regards,</p><p>&lt;%registered_migrant_agent%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9305, 1, 7174, 0, 'General', 'Email', 'Declaration of Other Names',
        'RE: Declaration of Other Names - Statutory Declaration', '', '', '',
        'Commonwealth of Australia<p align=\"center\">STATUTORY DECLARATION</p><p align=\"center\"><i>StatutoryDeclarations Act 1959</i></p><table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\"><tbody><tr><td width=\"14%\" valign=\"top\"><p></p><p><i>1 Insert the name, address and occupation of person making the declaration</i></p></td><td width=\"85%\" valign=\"top\"><p></p><p>I,<sup>1</sup></p><p><sup>&lt;%given_names%&gt; &lt;%family_name%&gt; Date of Birth: &nbsp;&lt;%DOB%&gt; residing at &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;;</sup></p><p></p><p></p><p></p><p>make the following declaration under the<i>Statutory Declarations Act1959:</i><b></b></p></td></tr><tr><td width=\"14%\" valign=\"top\"><p></p><p><i>2 Set out matter declared to in numbered paragraphs</i></p></td><td width=\"85%\" valign=\"top\"><p></p><p><sup>2</sup></p><p><font size=\"2\">I am also known by the following names:</font></p><p><font size=\"2\"><br></font></p><p><font size=\"2\">1. &lt;%other_names%&gt;</font></p><p><sup><br></sup></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p>I understand that a person who intentionally makes a false statement in a statutory declaration is guilty of an offence under section 11 of the<i>Statutory Declarations Act 1959</i>,<i></i>and I believe that the statements in this declaration are true in every particular.</p><p></p></td></tr><tr><td width=\"14%\" valign=\"top\"><p><i>3 Signature of person making the declaration</i></p></td><td width=\"85%\" valign=\"top\"><p><sup>3</sup></p><p></p><p><sup></sup></p></td></tr><tr><td width=\"14%\" valign=\"top\"><p><i>4 Place</i></p><p><i>5 Day</i></p><p><i>6 Month</i><i>and year</i></p></td><td width=\"85%\" valign=\"top\"><p>Declared at<sup>4</sup>on<sup>5</sup>of<sup>6</sup></p><p></p><p>Before me,</p><p><sup></sup></p></td></tr><tr><td width=\"14%\" valign=\"top\"><p><i>7 Signature of person before whom the declaration is made (see over)</i></p><p><i></i></p></td><td width=\"85%\" valign=\"top\"><p><sup>7</sup></p><p></p><p><sup></sup></p></td></tr><tr><td width=\"14%\" valign=\"top\"><p><i>8 Full name, qualification and address of person before whom the declaration is made (in printed letters)</i></p></td><td width=\"85%\" valign=\"top\"><p><sup>8</sup></p><p></p><p></p><p></p><p><sup></sup></p></td></tr></tbody></table><p><i>Note 1</i>Aperson who intentionally makes a false statement in a statutory declaration isguilty of an offence, the punishment for which is imprisonment for a term of 4years see section 11 of the<i>StatutoryDeclarations Act 1959</i>.</p><p><i>Note 2</i>Chapter2 of the<i>Criminal Code</i>applies to alloffences against the<i>StatutoryDeclarations Act 1959</i> see section 5A of the<i>Statutory Declarations Act 1959</i>.</p><p><b>A statutory declaration under the<i>Statutory Declarations Act 1959</i>may be made before</b></p><p>(1) a person who is currently licensed or registered under a law to practise in one of thefollowing occupations:</p><p>Chiropractor Dentist Legalpractitioner</p><p>Medical practitioner Nurse Optometrist</p><p>Patent attorney Pharmacist Physiotherapist</p><p>Psychologist Trademarks attorney Veterinarysurgeon</p><p>(2) a person who is enrolled on the roll of the Supreme Court of a State or Territory, orthe High Court of Australia, as a legal practitioner (however described); or</p><p>(3) a person who is in the following list:</p><p>Agent of the Australian Postal Corporation who isin charge of an office supplying postal services to the public</p><p>Australian Consular Officer or AustralianDiplomatic Officer (within the meaning of the<i>Consular Fees Act 1955</i>)</p><p>Bailiff</p><p>Bank officer with 5 or more continuous years ofservice</p><p>Building society officer with 5 or more years ofcontinuous service</p><p>Chief executive officer of a Commonwealth court</p><p>Clerk of a court</p><p>Commissioner for Affidavits</p><p>Commissioner for Declarations</p><p>Credit union officer with 5 or more years ofcontinuous service</p><p>Employee of the Australian Trade Commission who is:</p><p>(a) in a country or place outside Australia; and</p><p>(b) authorised under paragraph 3 (d) of the<i>ConsularFees Act 1955</i>; and</p><p>(c) exercising his or her function in that place</p><p>Employee of the Commonwealth who is:</p><p>(a) in a country or place outside Australia; and</p><p>(b) authorised under paragraph 3 (c) of the<i>ConsularFees Act 1955</i>; and</p><p>(c) exercising his or her function in that place</p><p>Fellow of the National Tax Accountants Association</p><p>Finance company officer with 5 or more years ofcontinuous service</p><p>Holder of a statutory office not specified inanother item in this list</p><p>Judge of a court</p><p>Justice of the Peace</p><p>Magistrate</p><p>Marriage celebrant registered under Subdivision Cof Division 1 of Part IV of the<i>Marriage Act 1961</i></p><p>Master of a court</p><p>Member of Chartered Secretaries Australia</p><p>Member of Engineers Australia, other than at thegrade of student</p><p>Member of the Association of Taxation andManagement Accountants</p><p>Member of the Australasian Institute of Miningand Metallurgy</p><p>Member of the Australian Defence Force who is:</p><p>(a) an officer; or</p><p>(b) a non-commissioned officer within the meaningof the<i>Defence Force Discipline Act 1982</i>with 5 or more years ofcontinuous service; or</p><p>(c) a warrant officer within the meaning of thatAct</p><p>Member of the Institute of Chartered Accountants inAustralia, the Australian Society of Certified Practising Accountants or theNational Institute of Accountants</p><p>Member of:</p><p>(a) the Parliament of the Commonwealth; or</p><p>(b) the Parliament of a State; or</p><p>(c) a Territory legislature; or</p><p>(d) a local government authority of a State orTerritory</p><p>Minister of religion registered under Subdivision Aof Division 1 of Part IV of the<i>Marriage Act 1961</i></p><p>Notary public</p><p>Permanent employee of the Australian PostalCorporation with 5 or more years of continuous service who is employed in anoffice supplying postal services to the public</p><p>Permanent employee of:</p><p>(a) the Commonwealth or a Commonwealth authority;or</p><p>(b) a State or Territory or a State or Territoryauthority; or</p><p>(c) a local government authority;</p><p>with 5 or more years of continuous service who isnot specified in another item in this list</p><p>Person before whom a statutory declaration may bemade under the law of the State or Territory in which the declaration is made</p><p>Police officer</p><p>Registrar, or Deputy Registrar, of a court</p><p>Senior Executive Service employee of:</p><p>(a) the Commonwealth or a Commonwealth authority;or</p><p>(b) a State or Territory or a State or Territoryauthority</p><p>Sheriff</p><p>Sheriffs officer</p><p>Teacher employed on a full-time basis at a schoolor tertiary education institution</p>',
        '2014-06-05', 'N', 0),
       (9306, 1, 7174, 74, 'General', 'Email', 'File Closed', 'Re: File Closed', '', '', '',
