        '2014-06-05', 'N', 0),
       (9307, 1, 7174, 74, 'General', 'Email', 'Documents Request', 'RE: Documents Request', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>The Department of Immigration has started processing your application and your case officer has requested the following documents:</p><p>&lt;%miss_docs_description%&gt;</p><p>We request you to upload these documents to your client portal as soon as possible.</p><p>Alternatively, you may email these documents to your Registered Migration Agent on &lt;%company_email%&gt;. You may also post these documents to - &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please note that the last day to submit these documents to your case officer is &lt;&lt;Insert Date&gt;&gt;.</p><p>You may contact us on &lt;%company_phone_1%&gt; or email us on &lt;%company_email%&gt; if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
