        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p><br></p><p>Please find below Statement of Services with regards to your &lt;%visa_subclass%&gt; matter.</p><p>&lt;%aud_curr_fin_transaction_table%&gt;</p><p>Please feel free to contact us if you have any questions,</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9310, 1, 7174, 74, 'General', 'Email', 'Withdrawal Template Client Request', 'RE: Withdrawal of Application',
        '', '', '',
        'From: &lt;%given_names%&gt; &lt;%family_name%&gt;<br>Date: &lt;%today_date%&gt;<p>Subject: Withdrawal of &lt;%visa_subclass%&gt; Application</p><p><br></p><p>I, &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth &lt;%DOB%&gt; residing at &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;; would like to withdraw my &lt;%visa_subclass%&gt; Application.</p><p><br></p><p>Below are the details of my application:</p><p><br></p><p>Date of Application: &lt;%visa_application_date%&gt;</p><p>File Number: &lt;%visa_application_file_number%&gt;</p><p>TRN: &lt;%visa_application_TRN%&gt;</p><p>Visa Subclass: &lt;%visa_subclass%&gt;</p><p><br></p><p>Dependents Included in the Application (If Any):</p><p><br></p><p>I understand that no further action will be taken once the application has been withdrawn. I also, understand that I may not be eligible for any refund.</p><p><br></p><p>Yours Sincerely,</p><p>&lt;%given_names%&gt; &lt;%family_name%&gt;</p><p><br></p>',
        '2014-06-05', 'N', 0),
       (9311, 1, 7174, 74, 'General', 'Email', 'Withdrawal of Application Agent Request',
        'RE: Withdrawal of Application', '', '', '',
        'To,<p>The Department of Immigration and Border Protection,</p><p>&lt;%immigration_office%&gt;</p><p>Date: &lt;%today_date%&gt;</p><p>Subject: Withdrawal of &lt;%visa_subclass%&gt; Application of our Client: &lt;%given_names%&gt; &lt;%family_name%&gt;; Date of Birth: &lt;%DOB%&gt;; File Number &lt;%visa_application_file_number%&gt;; TRN &lt;%visa_application_TRN%&gt;; Application ID &lt;%visa_application_ID%&gt;.</p><p><br></p><p>Dear Sir/Madam,</p><p><br></p><p>Our above mentioned client has instructed us to withdraw their &lt;%visa_subclass%&gt; Application.</p><p><br></p><p>Dependents included in the Application:</p><p><br></p><p><b>Details of Application:</b></p><p>Date of Application: &lt;%visa_application_date%&gt;</p><p>TRN: &lt;%visa_application_TRN%&gt;</p><p>File Number: &lt;%visa_application_file_number%&gt;</p><p>Application ID: &lt;%visa_application_ID%&gt;</p><p>Visa Subclass: &lt;%visa_subclass%&gt;</p><p><br></p><p>Please see attached authorisation from client to withdraw this application.</p><p><br></p><p>Please feel free to contact us if you have any questions:</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9312, 1, 7174, 74, 'General', 'Email', 'Confirmation of Withdrawal',
        'RE: Confirmation of Withdrawal of Application', '', '', '',
        '<font face=\"tahoma, arial, helvetica, sans-serif\">Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;</font><p>We refer to our conversation with regards to withdrawal of your &lt;%visa_subclass%&gt; Application. You have advised us that you would like to withdraw the above application which is under assessment as of today.</p><p>Please note that no further action will be taken on this application following its withdrawal. Please confirm this in writing so that we can communicate accordingly with the Department of Immigration.</p><p style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;\">Please feel free to contact us should you have any questions.</p><p>Regards,</p><p style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 12px;\">&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9313, 1, 7174, 74, 'General', 'Email', 'Notification of Grant', 'RE: Notification of Grant', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We are pleased to inform you that your &lt;%visa_subclass%&gt; Application has been approved.</p><p>Your Visa Approval Date is: &lt;%visa_outcome_date%&gt;</p><p>Your Visa Expiry Date is: &lt;%visa_expiry_date%&gt;</p><p>Your Visa Grant Number is: &lt;%visa_number%&gt;</p><p>Please log in to your client portal to find a copy of your approval letter. To access your client portal click: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>We have attached a copy of the approval letter with this email. It contains important information including the validity and conditions of your visa.</p><p>Congratulations, and please feel free to contact us if you have any questions.</p><p><br></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9314, 1, 7174, 74, 'General', 'Email', 'Notification of Refusal of Application', 'RE: Notification of Refusal',
        '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We regretfully inform you that your &lt;%visa_subclass%&gt; application has been refused.</p><p>Please log in to your client portal to access a copy of your Refusal Notification. To access your client portal click: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>A copy of the Notification is attached to this email.</p><p>Please note that you may have review rights with respect to this decision. Please contact us as soon as possible if you would like to discuss your review rights.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9315, 1, 7174, 74, 'General', 'Email', 'Receipt of Documents', 'RE: Receipt of Documents', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Thank you for providing requested documents.</p><p>We acknowledge receipt of the following documents:</p><p><font color=\"#ff0000\"><b>&lt;&lt;List Documents&gt;&gt;</b></font></p><p>Following Documents are still pending for your &lt;%visa_subclass%&gt; matter:</p><p>&lt;%miss_docs_description%&gt;</p><p>Please upload documents to your online Client Portal. To access your client portal, click: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a> Alternatively, you may choose to email these documents to &lt;%registered_migrant_agent%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9316, 1, 7174, 74, 'General', 'Email', 'Application Lodged', 'RE: Application Lodged', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p></p><p>We are pleased to inform you that your &lt;%visa_subclass%&gt; application has been lodged. Please find below details of your application:</p><p></p><p>Application Date: &lt;%visa_application_date%&gt;</p><p>TRN: &lt;%visa_application_TRN%&gt;</p><p>File Number: &lt;%visa_application_file_number%&gt;</p><p>Application ID: &lt;%visa_application_ID%&gt;</p><p></p><p>You may find a copy of your application on your client portal. To access your client portal click: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p></p><p>We will post an update on your portal as soon as we receive any information from the Department of Immigration.</p><p></p><p>Meanwhile, please feel free to contact on&lt;%company_phone_1%&gt; or by emailing on &lt;%company_email%&gt;.</p><p></p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9317, 1, 7174, 74, 'General', 'Email', 'Fax Template', 'RE: Fax', '', '', '',
        '<font size=\"2\">Fax</font><p></p><p></p><table border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\"><tbody><tr><td width=\"8%\"><p>To:</p></td><td width=\"40%\"><p></p></td><td width=\"8%\"><p>From:</p></td><td width=\"41%\"><p>&lt;%company_name%&gt;</p></td></tr><tr><td width=\"8%\"><p>Fax:</p></td><td width=\"40%\"><p></p></td><td width=\"8%\"><p>Pages:</p></td><td width=\"41%\"><p></p></td></tr><tr><td width=\"8%\"><p>Phone:</p></td><td width=\"40%\"><p></p></td><td width=\"8%\"><p>Date:</p></td><td width=\"41%\"><p>&lt;%today_date%&gt;</p></td></tr><tr><td width=\"8%\"><p>Re:</p></td><td width=\"40%\"><p>&lt;%given_names%&gt; &lt;%family_name%&gt;&nbsp;</p></td><td width=\"8%\"><p>Ref:</p></td><td width=\"41%\"><p>&lt;%file_number%&gt;</p></td></tr></tbody></table><p></p><p><br></p><p><br></p><p><br></p><p></p><br><p><font size=\"2\">&lt;%current_user_email_signature%&gt;</font></p>',
        '2014-06-05', 'N', 0),
       (9318, 1, 7174, 74, 'General', 'Email', 'Form 956 Agent End Appointment', 'RE: End Of Appointment Form 956', '',
        '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>You have instructed us to end our appointment as your Registered Migration Agent for your &lt;%visa_subclass%&gt; matter.</p><p>Please find attached Form 956 to be signed by you.</p><p>Please upload this form on your client portal. To access your client portal, click: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by emailing it to &lt;%registered_migrant_agent%&gt; or by Post&lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;</p><p>Please forward your new contact details to The Department of Immigration to receive further correspondence for your matter. &lt;%agent%&gt; will not be able to correspond with regards to the above mentioned matter you once this form is submitted.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9319, 1, 7174, 74, 'General', 'Email', 'Form 1023', 'RE: Form 1023', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>Please find attached Form 1023 to be signed by you and your dependents (if included in this application).</p><p>Please upload the signed form to your online client portal. To access your client portal, click: <a href=\"http://secure.officio.com.au\">http://secure.officio.com.au</a></p><p>Alternatively, you may return signed form either by email it to &lt;%registered_migrant_agent%&gt; or by Post &lt;%company_address%&gt; &lt;%company_city%&gt; &lt;%company_state%&gt; &lt;%company_zip%&gt; &lt;%company_country%&gt;.</p><p>Please feel free to contact us on &lt;%company_phone_1%&gt; or by Email &lt;%company_email%&gt;.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9320, 1, 7174, 0, 'General', 'Email', 'Default Email', 'RE: Email Received', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<br><br>Thank you for your email.<br><br><br><br>Regards,<br>&lt;%current_user_email_signature%&gt;',
        '2014-06-05', 'N', 0),
       (9321, 1, 7174, 74, 'General', 'Email', 'Police Clearance 2', 'RE: Your Police Clearance 2', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;,<p>We have applied for your police clearance for &lt;%2_country_of_PCC%&gt; on &lt;%2_PCC_application_date%&gt;.</p><p>Your Reference Number for this application is &lt;%2_PCC_reference_number%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p><br></p>',
        '2014-06-05', 'N', 0),
       (9322, 1, 7174, 74, 'General', 'Email', 'Police Clearance 3', 'RE: Your Police Clearance 3', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;,<p>We have applied for your police clearance for &lt;%3_country_of_PCC%&gt; on &lt;%3_PCC_application_date%&gt;.</p><p>Your Reference Number for this application is &lt;%3_PCC_reference_number%&gt;</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p><p><br></p>',
        '2014-06-05', 'N', 0),
       (9323, 1, 7174, 74, 'Payment', 'Email', 'Receipt of Payment - Non AUD', 'RE: Receipt of Payment', '', '', '',
        'Dear &lt;%given_names%&gt; &lt;%family_name%&gt;;<p>We acknowledge receipt of $&lt;%assign_deposit_amount%&gt;.</p><p>This amount will be kept in our Client/Trust Account and will be allocated towards services provided. The following is a summary of your Client Account.</p><p>&lt;%non_aud_curr_fin_transaction_table%&gt;</p><p>Balance: &lt;%trust_ac_balance_non_aud%&gt;</p><p>Thank you for your payment.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9324, 1, 7174, 74, 'General', 'Email', 'Cessation of Employment', 'RE: Cessation of Employment', '', '', '',
        'Dear Sir/Madam<p></p><p><b>VisaTransaction Reference Number (TRN):</b> &lt;%visa_application_TRN%&gt;<br><b>Visa Application ID:</b> &lt;%visa_application_ID%&gt;<br><b>Name of Approved Visa Holder:</b> &lt;%given_names%&gt; &lt;%family_name%&gt;<br><b>Passport Number:</b> &lt;%passport_number%&gt;<br><b>Visa Expiry:</b> &lt;%visa_expiry_date%&gt;<br><b>Name of Sponsor:</b> &lt;%link_to_employer_case%&gt;<br><b>Sponsorship/Agreement Application ID: </b>&lt;%sponsorship_agreement_number%&gt;</p><p></p><p>We wish to advise that &lt;%given_names%&gt; has ceased work with the sponsoring employer as of &lt;%nomination_termination_date%&gt;. </p><p></p><p>&lt;%given_names%&gt; can be contacted at the following:</p><p></p><p>Residential/postal address: &lt;%address_1%&gt; &lt;%address_2%&gt; &lt;%city%&gt; &lt;%state%&gt; &lt;%zip_code%&gt; &lt;%country%&gt;</p><p>Email: &lt;%email%&gt;</p><p>Phone: &lt;%phone_main%&gt;</p><p></p><p>Please do not hesitate to contact me if you require any further information.</p><p>Regards,</p><p>&lt;%current_user_email_signature%&gt;</p>',
        '2014-06-05', 'N', 0),
       (9363, 2, 7196, 83, 'General', 'Email', 'Missing Docs', 'Missing documents for <%family_name%>, <%given_names%>',
        '', '', '',
        '<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><img alt=\"\" src=\"http://dominica.gov.dm/images/gocd_coa.png\" style=\"height:44px; width:395px\" /><br />\n<br />\nDear&nbsp;Authorised Agent,<br />\n<br />\n<strong>Re: Economic Citizenship Application in favour&nbsp;</strong><strong>of</strong>&nbsp;<u><strong>&lt;%family_name%&gt;,&nbsp;&lt;%given_names%&gt;</strong></u></span></span><br />\n&nbsp;</div>\n\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">The application in favour of <u><strong>&lt;%title%&gt;&nbsp;</strong></u></span><u><strong>&lt;%family_name%&gt;, &lt;%given_names%&gt; </strong></u><span style=\"font-family:arial,helvetica,sans-serif\">&nbsp;was reviewed and the following documents were found to be missing or incomplete:<br />\n<br />\n<strong>&lt;%miss_docs_description%&gt;</strong></span></span></div>\n\n<div style=\"text-align:justify\">&nbsp;</div>\n\n<div style=\"text-align:justify\"><span style=\"font-size:14px\">Please visit the CBIU Online Portal </span><span style=\"font-size:14px\">at:</span><span style=\"font-size:14px\"> <a href=\"https://dominica.cbiu.online\">https://dominica.cbiu.online</a> to upload the missing documents. Once done, please click on <strong>Submit to CBIU</strong> to resubmit your application.&nbsp;</span></div>\n\n<div style=\"text-align:justify\">&nbsp;</div>\n\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Grateful if the outstanding documents are submitted within 60 days&nbsp;in order to continue the application process.<br />\n<br />\nRespectfully yours,<br />\n<br />\n&lt;%current_user_fName%&gt;&nbsp;&lt;%current_user_lName%&gt;<br />\n<strong>(FOR) COORDINATOR<br />\nCITIZENSHIP BY INVESTMENT UNIT</strong></span></span></div>\n\n<div style=\"text-align:justify\">&nbsp;</div>',
        '2017-09-13', 'N', 0),
       (9364, 2, 7196, 87, 'General', 'Email', 'Completed Application',
        'Application review completed <%family_name%>, <%given_names%>', '', '', '',
        '<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><img alt=\"\" src=\"http://dominica.gov.dm/images/gocd_coa.png\" style=\"height:44px; width:395px\" /><br />\n<br />\nDear&nbsp;Authorised Agent,<br />\n<br />\n<strong>Re: Economic Citizenship Application in favour&nbsp;</strong><strong>of</strong>&nbsp;<u><strong>&lt;%family_name%&gt;,&nbsp;&lt;%given_names%&gt;</strong></u></span></span><br />\n&nbsp;</div>\n\n<div style=\"text-align:justify\">\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">The application in favour of&nbsp;<u><strong>&lt;%title%&gt;&nbsp;&lt;%family_name%&gt;, &lt;%given_names%&gt;&nbsp;</strong></u>&nbsp;was reviewed&nbsp;and the application was found to be complete.</span></span><br />\n&nbsp;</div>\n\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">The Unit is now in the process of initiating a complete due diligence on the applicant. You will be informed of the status of the application upon the completion of a review by the Committee.</span></span></div>\n\n<div style=\"text-align:justify\">&nbsp;</div>\n\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Our records show that we have not yet received the Due Diligence fee. To pay this&nbsp;fee, please visit the CBIU Online Portal at: <a href=\"https://dominica.cbiu.online\">https://dominica.cbiu.online</a>&nbsp;and click on <strong>Pay by Credit Card </strong>inside your client&#39;s Accounting folder. You can make a single or incremental payments towards the outstanding balance. Once the payment is made, please inform us by email, so the application process resumes.&nbsp;</span></span></div>\n</div>\n\n<div style=\"text-align:justify\"><br />\n<span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Respectfully yours,<br />\n<br />\n&lt;%current_user_fName%&gt;&nbsp;&lt;%current_user_lName%&gt;<br />\n<strong>(FOR) COORDINATOR<br />\nCITIZENSHIP BY INVESTMENT UNIT</strong></span></span></div>\n\n<div style=\"text-align:justify\">&nbsp;</div>',
        '2017-09-13', 'N', 0),
       (9365, 2, 7196, 90, 'General', 'Email', 'Comfort', 'Application completed <%family_name%>, <%given_names%>', '',
        '', '',
        '<div style=\"text-align:justify\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\"><img alt=\"\" src=\"http://dominica.gov.dm/images/gocd_coa.png\" style=\"height:44px; width:395px\" /><br />\n<br />\nDear&nbsp;Authorised Agent,<br />\n<br />\n<strong>Re: Economic Citizenship Application in favour&nbsp;</strong><strong>of</strong>&nbsp;<u><strong>&lt;%family_name%&gt;,&nbsp;&lt;%given_names%&gt;</strong></u></span></span><br />\n&nbsp;</div>\n\n<div style=\"text-align:justify\">\n<div style=\"text-align:justify\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">We write to inform you that the application in favour of&nbsp;<u><strong>&lt;%title%&gt;&nbsp;&lt;%family_name%&gt;, &lt;%given_names%&gt;</strong></u>&nbsp;was successful.<br />\n<br />\nAs your client is applying under the &lt;%cbiu_investment_type%&gt; Option an amount of US$----------- in addition to US$------------------ naturalization and stamp fees must be deposited into the following account:</span></span>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Account No. 115003026</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Government of Dominica </span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Economic Citizenship Account</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">National Bank of Dominica</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">64 Hillsborough Street</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Roseau</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Commonwealth of Dominica</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Swift No. NCDMDMDM</span></span></div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">As soon as we have received evidence that the required amount has been deposited at the National Bank of Dominica, and that all relevant fees have been paid, we will finalize the application process.</span></span></div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Respectfully yours,<br />\n<br />\n&lt;%current_user_fName%&gt;&nbsp;&lt;%current_user_lName%&gt;<br />\n<strong>(FOR) COORDINATOR<br />\nCITIZENSHIP BY INVESTMENT UNIT</strong></span></span></div>\n</div>\n</div>\n\n<div style=\"text-align:justify\">&nbsp;</div>',
        '2017-09-13', 'N', 0),
       (9366, 2, 7196, 92, 'General', 'Email', 'Comfort MMCE', 'Application completed <%family_name%>, <%given_names%>',
        '', '', '',
        '<div style=\"text-align:justify\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\"><img alt=\"\" src=\"http://dominica.gov.dm/images/gocd_coa.png\" style=\"height:44px; width:395px\" /><br />\n<br />\nDear&nbsp;Authorised Agent,<br />\n<br />\n<strong>Re: Economic Citizenship Application in favour&nbsp;</strong><strong>of</strong>&nbsp;<u><strong>&lt;%family_name%&gt;,&nbsp;&lt;%given_names%&gt;</strong></u></span></span><br />\n&nbsp;</div>\n\n<div style=\"text-align:justify\">\n<div style=\"text-align:justify\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">We write to inform you that the application in favour of&nbsp;<u><strong>&lt;%title%&gt;&nbsp;&lt;%family_name%&gt;, &lt;%given_names%&gt;</strong></u>&nbsp;was successful.<br />\n<br />\nAs your client is applying under the &lt;%cbiu_investment_type%&gt; Option an amount of US$----------- in addition to US$------------------ naturalization and stamp fees must be deposited into the following account:</span></span>\n\n<div>&nbsp;</div>\n\n<div>\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Account No. 615000464</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Government of Dominica And Montreal Management Consulting EST. Ltd.</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">(MMCE) Housing Development Project</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">National Bank of Dominica Ltd.</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">64 Hillsborough Street</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Roseau, St George</span></span></div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">DOMINICA W.I</span></span></div>\n\n<div style=\"text-align:justify\"><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">NCDMDMDM</span></span></div>\n</div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">As soon as we have received evidence that the required amount has been deposited at the National Bank of Dominica, and that all relevant fees have been paid, we will finalize the application process.</span></span></div>\n\n<div>&nbsp;</div>\n\n<div><span style=\"font-family:arial,helvetica,sans-serif\"><span style=\"font-size:14px\">Respectfully yours,<br />\n<br />\n&lt;%current_user_fName%&gt;&nbsp;&lt;%current_user_lName%&gt;<br />\n<strong>(FOR) COORDINATOR<br />\nCITIZENSHIP BY INVESTMENT UNIT</strong></span></span></div>\n</div>\n</div>\n\n<div style=\"text-align:justify\">&nbsp;</div>',
        '2017-09-13', 'N', 0);
