       (9368, 2, 7197, 2, 'General', 'Email', 'Appliction is being sent to DD, waiting payment',
        'Due Diligence fee is required for <%family_name%>, <%given_names%>', 'support@dominica.cbiu.online', '', '',
        '<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><img alt=\"\" src=\"http://dominica.gov.dm/images/gocd_coa.png\" style=\"height:44px; width:395px\" /><br />\n<br />\nDear&nbsp;Authorised Agent,<br />\n<br />\n<strong>Re: Economic Citizenship Application in favour&nbsp;</strong><strong>of</strong>&nbsp;<u><strong>&lt;%family_name%&gt;,&nbsp;&lt;%given_names%&gt;</strong></u></span></span><br />\n&nbsp;</div>\n\n<div style=\"text-align:justify\">\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">The application in favour of&nbsp;<u><strong>&lt;%title%&gt;&nbsp;&lt;%family_name%&gt;, &lt;%given_names%&gt;&nbsp;</strong></u>&nbsp;was reviewed&nbsp;and the </span></span><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Unit is now in the process of initiating a complete due diligence on the applicant. You will be informed of the status of the application upon the completion of a review by the Committee.</span></span></div>\n\n<div style=\"text-align:justify\">&nbsp;</div>\n\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Our records show that we have not yet received the Due Diligence fee. To pay this&nbsp;fee, please visit the CBIU Online Portal at: <a href=\"https://dominica.cbiu.online\">https://dominica.cbiu.online</a>&nbsp;and click on <strong>Pay by Credit Card </strong>inside your client&#39;s Accounting folder. You can make a single or incremental payments towards the outstanding balance. Once the payment is made, please inform us by email, so the application process resumes.&nbsp;</span></span></div>\n</div>\n\n<div style=\"text-align:justify\"><br />\n<span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Respectfully yours,<br />\n<br />\n<br />\n<strong>(FOR) EMMANUEL NANTHAN,&nbsp;</strong></span></span><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>COORDINATOR<br />\nCITIZENSHIP BY INVESTMENT UNIT</strong></span></span></div>\n\n<div style=\"text-align:justify\">&nbsp;</div>',
        '2017-09-27', 'N', 0),
       (9369, 2, 7197, 0, 'General', 'Email', 'Invitation', 'Invitation', 'enanthan@cwdom.dm', '', '',
        '<div style=\"text-align:justify\">&nbsp;</div>\n\n<div style=\"text-align:justify\">\n<div style=\"text-align:center\"><img alt=\"\" src=\"https://dominica.cbiu.online/cbiu_logo2.png\" /></div>\n\n<div style=\"text-align:center\"><span style=\"font-size:16px\">The Prime Minister of the&nbsp;<br />\nCommonwealth of Dominica,&nbsp;<br />\n<strong>His Excellency The Honorable&nbsp;<br />\nDr Roosevelt Skerrit,&nbsp;</strong><br />\nrequests the honor of your presence at the Invitation.</span><br />\n<span style=\"font-size:20px\"><strong>Hurricane Maria Relief,&nbsp;<br />\nResilience &amp; Rebuilding&nbsp;<br />\nAfternoon</strong></span><br />\n<br />\n<span style=\"font-size:16px\">Date: November 10. Time: 3 p.m.&nbsp;<br />\nVenue: West Side Lawn,&nbsp;<br />\nKempinski Palm Jumeirah, Dubai&nbsp;<br />\nDress Code: Smart Casual</span></div>\n\n<div style=\"text-align:center\">&nbsp;</div>\n\n<div style=\"text-align:center\"><span style=\"font-size:16px\">Please RSVP&nbsp;by sending an email to: opminfo@dominica.gov.dm&nbsp;&nbsp;</span></div>\n\n<div>\n<div style=\"text-align:center\">&nbsp;</div>\n\n<div dir=\"ltr\">\n<div>&nbsp;</div>\n\n<div>&nbsp;</div>\n</div>\n</div>\n\n<div>&nbsp;</div>\n</div>',
        '2017-10-03', 'N', 0),
