        '<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><img alt=\"\" src=\"http://dominica.gov.dm/images/gocd_coa.png\" style=\"height:44px; width:395px\" /><br />\n<br />\nDear&nbsp;Authorised Agent,<br />\n<br />\n<strong>Re: Economic Citizenship Application in favour&nbsp;</strong><strong>of</strong>&nbsp;<u><strong>&lt;%family_name%&gt;,&nbsp;&lt;%given_names%&gt;</strong></u></span></span><br />\n&nbsp;</div>\n\n<div style=\"text-align:justify\">\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">The Unit has initiated the complete due diligence for the application in favour of&nbsp;<u><strong>&lt;%title%&gt;&nbsp;&lt;%family_name%&gt;, &lt;%given_names%&gt;.</strong></u>&nbsp; </span></span><br />\n&nbsp;</div>\n\n<div style=\"text-align:justify\"><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Our records show that the Due Diligence fee has not been paid in full. To pay the balance, kindly visit the CBIU Online Portal at: <a href=\"https://dominica.cbiu.online\">https://dominica.cbiu.online</a>&nbsp;and click on <strong>Pay by Credit Card </strong>inside your client&#39;s Accounting folder. You can make a single or incremental payments towards the outstanding balance. Once the payment is made, please inform us by email, so the application process resumes.&nbsp;</span></span></div>\n</div>\n\n<div style=\"text-align:justify\"><br />\n<span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\">Respectfully yours,<br />\n<br />\n<br />\n<strong>(FOR) EMMANUEL NANTHAN,&nbsp;</strong></span></span><span style=\"font-size:14px\"><span style=\"font-family:arial,helvetica,sans-serif\"><strong>COORDINATOR<br />\nCITIZENSHIP BY INVESTMENT UNIT</strong></span></span></div>\n\n<div style=\"text-align:justify\">&nbsp;</div>',
