--
-- Table structure for table `tickets`
--

CREATE TABLE `tickets`
(
    `ticket_id`         int(11) UNSIGNED                       NOT NULL,
    `company_id`        bigint(20)                                      DEFAULT NULL,
    `company_member_id` bigint(20)                                      DEFAULT NULL,
    `author_id`         bigint(20)                                      DEFAULT NULL,
    `ticket`            text,
    `contacted_by`      enum ('phone','email','chat','system') NOT NULL DEFAULT 'phone',
    `status`            enum ('resolved','not_resolved')       NOT NULL DEFAULT 'not_resolved',
    `create_date`       datetime                                        DEFAULT NULL
) ENGINE = InnoDB
  DEFAULT CHARSET = utf8 COMMENT ='List of tickets that are used as notes for companies (for superadmin section only).';

