--
-- Structure for view `view_active_users`
--
DROP TABLE IF EXISTS `view_active_users`;

CREATE VIEW `view_active_users` AS
select `c`.`company_id` AS `company_id`, count(`m`.`member_id`) AS `active_users_count`
from (`company` `c`
         left join `members` `m` on ((`m`.`company_id` = `c`.`company_id`)))
where ((`m`.`userType` in (2, 4)) and (`m`.`status` = 1))
group by `c`.`company_id`;

-- --------------------------------------------------------

--
-- Structure for view `view_clients_count`
--
DROP TABLE IF EXISTS `view_clients_count`;

CREATE VIEW `view_clients_count` AS
select `c`.`company_id` AS `company_id`, count(`m`.`member_id`) AS `clients_count`
from (`company` `c`
         left join `members` `m` on ((`m`.`company_id` = `c`.`company_id`)))
where (`m`.`userType` = 3)
group by `c`.`company_id`;

-- --------------------------------------------------------

--
-- Structure for view `view_last_mail_used`
--
DROP TABLE IF EXISTS `view_last_mail_used`;

CREATE VIEW `view_last_mail_used` AS
select `c`.`company_id`             AS `company_id`,
       max(`a`.`last_manual_check`) AS `last_manual_check`,
       max(`a`.`last_mass_mail`)    AS `last_mass_mail`
from ((`company` `c` left join `members` `m` on ((`m`.`company_id` = `c`.`company_id`)))
         left join `eml_accounts` `a` on ((`m`.`member_id` = `a`.`member_id`)))
group by `c`.`company_id`;

-- --------------------------------------------------------

--
-- Structure for view `view_last_ta_uploaded`
--
DROP TABLE IF EXISTS `view_last_ta_uploaded`;

CREATE VIEW `view_last_ta_uploaded` AS
select `c`.`company_id` AS `company_id`, max(`i`.`import_datetime`) AS `last_ta_uploaded_date`
from ((`company` `c` left join `company_ta` `ta` on ((`c`.`company_id` = `ta`.`company_id`)))
         left join `u_import_transactions` `i` on ((`i`.`company_ta_id` = `ta`.`company_ta_id`)))
group by `c`.`company_id`;

